- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XN\x1CThe Fairfax County Democratic Committee
    is filing monthly in 2008 because gross receipts exceed $100,000 and because the
    Committee engages in federal election activity this year. The committee has one
    full time employee and one part time employee. The full time employee devotes
    more than 25 percent of his time to federal elections this year, and therefore,
    his salary and benefits are paid entirely with federal funds.  Disbursements for
    employee compensation and related expenses of the part time employee are not reflected
    in this report, as all of his compensated time is devoted to non federal elections.
    With the exception of these two employees, the Committee is staffed entirely with
    volunteers.  The Committee maintains separate bank accounts for its non-federal
    and its federal election receipts and expenditures. Administrative expenses are
    allocable under Federal regulations, and transfers of non federal funds are made
    retroactively to the Federal account. For the months of August and September,
    administrative expenses beginning August 11 and ending September 30, 2008 were
    transferred from our non federal to our federal account on October 10, 2008 (shown
    in this report).  In the future, the Committee will allocate administrative expenses
    between its federal and non federal accounts, and will transfer between the accounts
    on a monthly basis for the previous month. "
